import React from "react";
import Songlibrary from './Songlibrary'
function Songcollection({songs}){

	

		return(
		
		
		<div class="libray">
		<h1>libray</h1>
		<div className="llibrary_song">
		{
		songs.map((song)=>{
		
		< Songlibrary song={song}/>
		}
		)
		}
		</div>
		
		</div>
		
		
		
		
		)
		
		
		
	}
	
	
	
	


export default Songcollection
